// Grab contacts from the previous node
const contacts = items[0].json.contacts || [];

// Set your target email (hardcode for testing, or read dynamically)
const targetEmail = $json.email || "huw@talentism.com";

if (!targetEmail) {
  return [{ json: { error: "No targetEmail provided" } }];
}

// Filter only those contacts that actually have an email
const match = contacts.filter(c => 
  c.email && c.email.toLowerCase() === targetEmail.toLowerCase()
);

// Return results or a clear message if not found
if (match.length === 0) {
  return [{ json: { message: "No contact found for " + targetEmail } }];
}

return match.map(c => ({ json: c }));
